function exit(n){swal({title:"Sure to stop this agent?",type:"warning",showCancelButton:!0},function(){app.post("/agent/"+n+"/exit",null,function(){swal("Success","Send signal success","success")},function(){swal("Error","Stop agent failed","error")})})}function deleteAgent(n){swal({title:"Sure to delete this agent?",type:"warning",showCancelButton:!0},function(){app.delete("/agent/"+n,function(){window.location.reload()},function(){swal("Error","Delete agent failed","error")})})}$(function(){app.activeMenu("DownloaderAgent")});